import React from "react";
import * as S from "./styled"
import RepositoryItem from "../repository-item"

const Repositories = () => {
    return (
        <S.WrapperTabs
        selectedTavClassName="is-selected"
        selectedTabPanelClassName="is-selected"
        >
            <S.WrapperTabList>
                <S.WrapperTab>Repositories</S.WrapperTab>
                <S.WrapperTab>Starred</S.WrapperTab>
            </S.WrapperTabList>
            <S.WrapperTabPanel><RepositoryItem name="Angular" link="https://github.com/Lucas-S-Canno/Angular" fullName="Lucas-S-Canno/Angular" /></S.WrapperTabPanel>
            <S.WrapperTabPanel><RepositoryItem name="Angular" link="https://github.com/Lucas-S-Canno/Angular" fullName="Lucas-S-Canno/Angular" /></S.WrapperTabPanel>
        </S.WrapperTabs>
        );
}

export default Repositories;
